"""##4.3 *Kolmogorov-Smirnov Test*

$(H)$: The sample distribution matches the reference normal distribution.\
$(H)$: The sample distribution does not match the reference normal distribution.
"""

from scipy.stats import kstest, norm

numeric_columns = ['Score', 'GDP per capita', 'Social support', 'Healthy life expectancy',
                   'Freedom to make life choices', 'Generosity', 'Perceptions of corruption']

#Store Kolmogorov-Smirnov tests
ks_results = {}

for column in numeric_columns:
    # Perform the K-S test comparing the data to a normal distribution with the same mean and std
    stat, p_value = kstest(df[column], 'norm', args=(df[column].mean(), df[column].std()))
    ks_results[column] = p_value
    print(f'Kolmogorov-Smirnov Test for {column}: Test Statistic={stat}, p-value={p_value}')

    if p_value > 0.05:
        print(f"Fail to reject H: {column} appears to be normally distributed (p > 0.05).\n")
    else:
        print(f"Reject H: {column} does not appear to be normally distributed (p <= 0.05).\n")

"""##4.4 *Shapiro-Wilk test*

Hypotheses for Normality Testing:\
Null Hypothesis $(H)$: The data for each variable follows a normal distribution.\
Alternative Hypothesis $(H)$: The data for each variable does not follow a normal distribution.\
"""

from scipy.stats import shapiro


numeric_columns = ['Score', 'GDP per capita', 'Social support', 'Healthy life expectancy',
                   'Freedom to make life choices', 'Generosity', 'Perceptions of corruption']

# Perform the Shapiro-Wilk test for each variable
for column in numeric_columns:
    stat, p = shapiro(df[column])
    print(f'Shapiro-Wilk Test for {column}: Test Statistic={stat}, p-value={p}')


    if p > 0.05:
        print(f"Fail to reject H: {column} appears to be normally distributed (p > 0.05).\n")
    else:
        print(f"Reject H: {column} does not appear to be normally distributed (p <= 0.05).\n")

